(13, 'Test', 'test', 'test', 'test', 'TESTETSTEST', '2014-03-24 12:41:32'),
(14, 'kiqjcsjnvh(dquot)(squot)eaceu', 'kiqjcsjnvh(dquot)(squot)eaceu', 'kiqjcsjnvh(dquot)(squot)eaceu', 'kiqjcsjnvh(dquot)(squot)eaceu', 'kiqjcsjnvh(dquot)(squot)eaceu', '2014-03-24 19:14:45'),
(15, 'GastonDsv', '', 'gaston.dsv@facebook.com', 'Rencontres et plus si affinites', 'Hey Dame Tenebra!! J(squot)ai decouvert ton site par Tinder... Tres chouette et tu es plutot une jolie fille!! Je me demanderais si tu accepterais d(squot)aller boire un verre histoire de faire connaissance et plus si affinites!?\n\nBises @+', '2014-05-10 11:09:14'),
(16, 'Ericboffy', 'www.ericboffy.com', '', 'Photographe breton a Antony bientot', 'Bonjour j(squot)ai vu votre profil sur Modele Ile de France (Je suis sur Modeles Bretagne). Je serais sur Antony a partir de dimanche jusqu(squot)au 1 juillet. Je vous invite a visiter mon site: www?ericboffy.com Si mes photos vous plaisent et que vous aimeriez faire une seance, contactez moi. Eric', '2014-06-21 13:57:31'),
(17, 'MIK', 'www.eyepitphotographies.com', 'eyepitphotographies@hotmail.fr', 'COLLAB samedi 05 juillet', 'Bonjour , je suis MI[K] d(squot)Eyepit Photographies \nJe serais sur Paris les samedi 05 et dimanche 06 juillet et je cherche a caler quelques seances.\nJe viens de regarder vos photos sur modele-france.info et je serais interesse pour une collab avec vous.\nvoici quelques liens concernant mes travaux :\n\nMon site : www.eyepitphotographies.com\nMon facebook : https://www.facebook.com/eyepitphotographies\nMon kabook : eyepitphotographies.kabook.fr\n\nPs : je passe par votre site car vous ne vous connectez pas souvent sur votre page.\n\nBonne journee', '2014-07-02 11:19:12'),
(18, 'MIK', 'www.eyepitphotographies.com', 'eyepitphotographies@hotmail.fr', 'COLLAB samedi 05 juillet', 'Bonjour , je suis MI[K] d(squot)Eyepit Photographies \nJe serais sur Paris les samedi 05 juillet et je cherche a caler quelques seances.\nJe viens de regarder vos photos sur modele-france.info et je serais interesse pour une collab avec vous.\nvoici quelques liens concernant mes travaux :\n\nMon site : www.eyepitphotographies.com\nMon facebook : https://www.facebook.com/eyepitphotographies\nMon kabook : eyepitphotographies.kabook.fr\n\nPs : je passe par votre site car vous ne vous connectez pas souvent sur votre page.\n\nBonne journee', '2014-07-02 11:19:12'),
(19, '', '', '', '', '', '2014-08-09 03:42:34'),
(20, '', '', '', '', '', '2014-08-09 03:42:48'),
(21, '', '', '', '', '', '2014-09-29 08:51:18'),
(22, 'Le testeur psychopathe', 'TEST', '&e~^u*$', '&e~^u*$', '&e~^u*$', '2014-09-29 13:20:05'),
(23, 'Maelstrom Photography ', '', 'cyril.darricau@Gmail.com', 'shooting photo ', 'Bonsoir !\n\nJe suis photographe amateur, j(squot)ai 24 ans et je viens d(squot)arriver en Ile-de-france. Je cherche des contacts ici pour discuter et eventuellement developper des projets photographiques.\n\nVoici ma page Facebook :\nhttps://facebook.com/MaelstromPhoto\n\nJe suis specialiste de lingerie/glamour (tres soft) et metalleux donc j(squot)adore l(squot)imagerie Goth mais je suis tres ouvert a toute autre proposition de projet.\n\nJ(squot)aimerais, en ce moment, faire un shooting au pere lachaise donc si tu es interessee on peut en discuter :)\n\nMerci d(squot)avance pour ta reponse et a bientot j(squot)espere !\n\nBonne soiree !\n\nCyril M.', '2014-10-05 23:01:57'),
(24, '', '', '', '', '', '2014-11-02 08:49:24'),
(25, 'sevvilor', 'www.varimint.blogspot.com', 'sevilor@gmail.com', 'attestation et scan', 'bonsoir amandine\n\nje t(squot)ai tel cet apres midi d(squot)un cybercafe et laisser un message,j(squot)ai bien eu ton sms ce matin\n\nje t(squot)avais deja envoye l(squot)attestation via le contact de ton book.fr (et je te l(squot)ais dit ensuite sur facebook) mais si il faut la refaire et te la renvoyer,il y a pas de probleme\n\nj(squot)ai arreter mon facebook car pour moi c(squot)est une illusion et une perte d(squot)esperance de penser que cela sont des amis qu(squot)on as et pui la moi,je ne suis vraiment pas bienb moralement\n\nj(squot)ai tes deux scans,il me faut un mail pour te les envoyer\n\nthomas', '2014-11-10 18:01:57'),
(26, '', '', '', '', '', '2015-04-10 19:14:50'),
(27, 'melaniebouju', 'www.fannymaeck.com', 'fannymaeck@gmail.com', 'Agent Artistique', 'Bonjour, \n\nMelanie Bouju, Agent Artsitique, je vous ecris suite a la vue de votre book en ligne. Si je peux me permettre, vous avez un potentiel quâ€™il faudrait exploiter avec lâ€™aide dâ€™un Photographe professionnel. Avec maquillage pro et retouches. \nSi cela vous interesse, je connais les coordonnees de quelques photographes en Ile de France. Johanna Gringant, Fanny Maeck, Leslie Rogi, etc. \nJe vous donne les coordonnees de lâ€™une dâ€™elles: \nFanny MAECK, en projet avec le producteur de Rayane Bensetti et egalement le producteur de Laam. \nwww.fannymaeck.com\nPhotographe Freelance\nfannymaeck@gmail.com\n0665912562\n\nJe travaille entre autres avec NRJ Paris, 2 agences belges et 3 parisiennes, vos photos seraient mises en ligne sur le site de la Photographe que vous choisiriez, visible par un grand nombre de professionnels, ce qui pourrait vous ouvrir des portes dans le milieu du mannequinat. \n\nSi vous souhaitez les coordonnees dâ€™un autre photographe, nâ€™hesitez pas a me recontacter. ', '2015-04-18 13:07:55'),
(28, 'thomas', 'www.thomassmithphotographer.blogspot.com', 'varimint@hotmail.fr', 'dont forget me ', 'bonsoir amandine\n\nj(squot)espere que tu vas bien\n\nmoi...comme d(squot)habitude...photos et cinema\n\nj(squot)ai photographier beaucoups de modele pour ce projet d(squot)expo mais je voulais te dire que tu etait une de mes modeles preferer car tu as ete une des rares ou la seule a comprendre qui je suis\n\nbonne fin de soiree\n\nthomas smith', '2015-04-28 21:01:19'),
(29, 'OfficeRiders', 'www.officeriders.com', 'hello@officeriders.com', 'Aide ', 'Bonjour, si tu cherche des appartements pour shooter, n(squot)hesite pas a te rendre sur officeriders.com. Plein d(squot)appartements chez les particuliers sont disponibles et pour un prix defiant toutes concurrences ! \n\nAu plaisir de vous voir sur OfficeRiders !', '2015-04-29 11:17:39'),
(30, 'Mind', '', 'absymind@gmail.com', 'Vente bustier goth', 'bonjour j(squot)ai vu que tu vendais qq articles de toute beaute je serais sur paris debut juin je t(squot)en prendrais bien un lot pour les shootings prochains...au plaisir Mind', '2015-05-08 10:00:24'),
(31, 'Artsanso', '', 'silver@mail2oliver.com', 'A propos de votre page', 'bonjour dame t\n\nVos photos sont biens jolie et forte en emotions \nQue genre d(squot)appareil photo utilisee vous pour faire vos travaux.\n\nJe vais mettre un petit j(squot)aime \n\nCordialement ', '2015-08-04 17:07:33'),
(32, '', '', '', '', '', '2015-08-06 21:11:28'),
(33, 'Stephane G', 'stephane-g-photographie.fr/sets/portraits/', 'sgouget@gmx.fr', 'Collaboration photographique ', 'Bonjour, photographe amateur en region parisienne. \n\nJe suis en recherche de collaboration, essentiellement pour du portrait \n\nDisponible a partir de septembre\n\nCordialement,\n\nhttp://stephane-g-photographie.fr/sets/portraits/', '2015-08-25 04:55:50'),
(34, '', '', '', '', '', '2015-09-18 05:50:45');
